Nature Documentary hosted by Josh Goodman, published by National Geographic in 2014 - English narration


Information
------------------------------

Animals Gone Wild
How outrageous can the animal kingdom get? Whether it's out-of-bounds behavior or savage instincts run amok, when animals act out they're a force to be reckoned with. From the mysterious depths of the deep blue sea to the jungle's untamed edge, see just how rough, rowdy, and lawless Mother Nature's most unruly creatures can be.


1)  Disorderly Conduct 
How outrageous can the animal kingdom get? Whether it's out-of-bounds behavior or savage instincts running wild, when animals act out, they're forces to be reckoned with. When a man with a young son and beloved dog spots a 3-foot-long copperhead in his woodpile, he feels he has to protect his family. But even a snake with a chopped head is a cause for concern! Later, a Great Dane corners a kangaroo and ends up in the heavyweight fight of its life.

2)  Shock and Awe 
When fight-or-flight instincts kick in, anything is possible, and animals will go to extremes to survive. After finding itself trapped on a fishing boat, an octopus appears to have no chance for escape, but it somehow manages to push its body, and science, in ways that are seemingly impossible. Later, a 200-pound male orangutan goes above and beyond to save an injured baby bird from drowning in a pond at a zoo. And when a bear loses her cub, she goes to deadly extremes to reunite with her baby.

3)  Ambushed 
From sudden shocks and blindsiding attacks, to jaw dropping body slams and bone-rattling collisions, the animal kingdom is full of astonishing ambushes. Find out what happens when a newborn panda does everything in its power to escape from behind crib bars. Then, a day of fishing takes a turn when a professional kayaker encounters a fierce goose with an attitude problem. Later, park researchers catch a group of grizzly bears taking an instinctual act of communication to a ridicuculous new level.

4)  Believe It or not 
From grizzlies in the Alaskan terrain to the lovable pets in our homes, nature never ceases to astonish when animals show off their unique behaviors. Watch a ravenous python try to gorge on prey that is many times larger than its own size. Witness how a fearless and aggressive goose taunts a massive gorilla. And see how a slow two-headed turtle tries to navigate and survive its fast-paced environment.

5)  Surprisingly Human 
They're some of the animal kingdom's most resilient and creative creatures. These animals make the best of their situations and prove to us all the power of keeping an open mind. Witness an incredible fight for survival when an elusive and stealthy jaguar takes on a massive caiman. Elsewhere, a 7-year-old and his pet python possess a bond that defies all logic. Later, when two feisty felines start a catfight, in steps a peacekeeper -- a monkey that won't put up with any monkey business!

6)  Freak Encounters 
Every day in every corner of the world - our own backyards, the streets of our towns and our favorite vacation spots - we risk freak encounters with Mother Nature's most erratic animals. Expect the unexpected as the most incredible stories come from the most unlikely places. A policeman gets a surprise when an irate primate interrupts a routine traffic stop, and a slithering serpent takes massage sessions to a whole new level. Expect everything from shocking to stunning to just plain strange.

